    function similarity (u, v){
        var sum = 0;
        var total = 0;
        for (var i=0; i<u.length; i++){
            for (var j=0; j<v.length; j++){
                if (u[i] == v[j]){
                    sum++;
                }                
            }
            total++;
        }
        for (var j=0; j<v.length; j++){
            for (var i=0; i<u.length; i++){            
                if (u[i] == v[j]){
                    sum++;
                }                
            }
            total++;
        }
        console.log(u + ' ' + v + ' ' + sum + '/' + total + '=' + sum/total)
        return sum/total;
    }
